f.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1235","type":"BasicTickFormatter"},{"attributes":{"fill_color":{"field":"bandwidth","transform":{"id":"1146"}},"height":{"units":"data","value":1},"line_color":{"field":"bandwidth","transform":{"id":"1146"}},"width":{"units":"data","value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1166","type":"Rect"},{"attributes":{"formatter":{"id":"1233"},"ticker":{"id":"1016"},"visible":false},"id":"1015","type":"LinearAxis"},{"attributes":{},"id":"1044","type":"LinearScale"},{"attributes":{"axis":{"id":"1158"},"ticker":null},"id":"1160","type":"Grid"},{"attributes":{"data_source":{"id":"1071"},"glyph":{"id":"1100"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1103"}},"id":"1102","type":"GlyphRenderer"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","logo":null,"tools":[{"id":"1208"}]},"id":"1197","type":"Toolbar"},{"attributes":{"factors":[]},"id":"1184","type":"FactorRange"},{"attributes":{},"id":"1239","type":"BasicTickFormatter"},{"attributes":{"axis":{"id":"1081"},"ticker":null,"visible":false},"id":"1084","type":"Grid"},{"attributes":{"formatter":{"id":"1247"},"major_label_orientation":-0.2617993877991494,"ticker":{"id":"1159"}},"id":"1158","type":"CategoricalAxis"},{"attributes":{},"id":"1156","type":"CategoricalScale"},{"attributes":{"dimensions":"width"},"id":"1021","type":"WheelZoomTool"},{"attributes":{},"id":"1086","type":"BasicTicker"},{"attributes":{},"id":"1275","type":"Selection"},{"attributes":{"start":0},"id":"1182","type":"DataRange1d"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-famil
